import React from 'react'
import styles from './index.module.css'

interface HeroProps {
    name: String, 
    job: String, 
    greeting: String, 
    description: String
}

const Hero = ({name, job, greeting, description}: HeroProps) => {
  return (
    <section id='aboutMe' className= {styles.hero} >
        <h1 className= { styles.hero_name } > { name } </h1>
        <div className= { styles.hero_job } > { job } </div>
        <div className= { styles.hero_greeting } > { greeting } </div>
        <div className= { styles.hero_description } > { description } </div>
    </section>
  )
}

export default Hero
